	CREATE TABLE CITIS_agency (
        agency_name VARCHAR (80) PRIMARY KEY,
        agency_url VARCHAR (80)
	);
       
    CREATE TABLE CITIS_route (
        route_id VARCHAR (40) PRIMARY KEY,
        route_short_name VARCHAR (40),
        route_long_name VARCHAR (80),
        route_color VARCHAR (40),
        route_text_color VARCHAR (40),
        agency_name VARCHAR (80) REFERENCES CITIS_agency (agency_name)
    );
             
    CREATE TABLE CITIS_trip (
        trip_id VARCHAR (40) PRIMARY KEY,
        route_id VARCHAR (80) REFERENCES CITIS_route (route_id),
        trip_long_name VARCHAR (80),
        notes VARCHAR (200)
    );
       
    CREATE TABLE CITIS_stop (
        stop_id VARCHAR (40) PRIMARY KEY,
        stop_name VARCHAR (80),
        x_coor VARCHAR (40),
        y_coor VARCHAR (40),
        stop_city VARCHAR (80),
        parent_id VARCHAR (40) NULL
    );
       
    CREATE TABLE CITIS_stop_time (
        trip_id VARCHAR (40) REFERENCES CITIS_trip (trip_id),
        stop_id VARCHAR (40) REFERENCES CITIS_stop (stop_id),
        departure_time TIME,
        stop_sequence INT,
        notes VARCHAR (200),
        CONSTRAINT CITIS_PK_stop_times PRIMARY KEY (trip_id, stop_id, stop_sequence)
    );
       
    CREATE TABLE CITIS_specific_trip (
        specific_trip_id VARCHAR (40) PRIMARY KEY,
        departure TIME NOT NULL,
        n_route VARCHAR (30),
        trip_id VARCHAR (40) REFERENCES CITIS_trip (trip_id),
        calendar_id VARCHAR (40) NOT NULL REFERENCES CITIS_calendar (calendar_id)
    );
   
    CREATE TABLE  CITIS_calendar(
        calendar_id VARCHAR (40) PRIMARY KEY,
        days_list VARCHAR (60) NOT NULL
    );
       
    CREATE TABLE CITIS_users (
        id INT PRIMARY KEY,
        name VARCHAR (40) NOT NULL,
        surname VARCHAR (45) NOT NULL,
        email VARCHAR (45) NOT NULL,
        password VARCHAR (45) NOT NULL,
        rol INT DEFAULT 0,
        photo BLOB
    );
   
    CREATE TABLE CITIS_favstop (
        id_user VARCHAR (40) REFERENCES CITIS_users (id_user),
        stop_id VARCHAR (40) REFERENCES CITIS_stop (stop_id)
    );












































































